s = '$'
k = 16
t = []
with open('rosalind_lrep.txt') as f1:
    for line in f1:
        t.append(line.strip().split())
t = t[2:]

#find parent nodes >= k
i=[]
for n in t:
    if n[0] not in i:
        i.append(n[0])

c=[]
for n in i:
    e=0
    q = [n]
    for l in t:
        if l[0] in q:
            q.append(l[1])
            if int(l[2]) + int(l[3]) == len(s) + 1:
                e+=1
    if e >= k:
        c.append(n)

#find the longest substring
out=''
for j in c[1:]:
    sub = []
    for n in t[::-1]:
        if n[1] == j:
            sub.append(s[int(n[2])-1:int(n[2])-1+int(n[3])])
            if n[0] == "node1":
                if len(''.join(sub)) > len(out):
                    out = ''.join(sub[::-1])
                    break
            else:
                j = n[0]
            
print(out)
